"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[4851],{63391:(t,e,n)=>{n.r(e),n.d(e,{default:()=>s,johnChapter3PL:()=>r});const r={chapter:3,title:"Jana 3",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"A by\u0142 cz\u0142owiek z Faryzeusz\xf3w, imieniem Nikodem, ksi\u0105\u017c\u0119 \u017bydowskie.",strong:[{text:"homme",strong:"G444",start:17,end:22}]},{number:2,text:"Ten przyszed\u0142 do Jezusa w nocy i rzek\u0142 mu: Mistrzu! wiemy, \u017ce\u015b od Boga przyszed\u0142 jako nauczyciel; albowiem \u017caden nie mo\u017ce tych znak\xf3w czyni\u0107, kt\xf3re ty czynisz, tylko by\u0142 li B\xf3g z nim.",strong:[{text:"nuit",strong:"G3571",start:35,end:39},{text:"docteur",strong:"G1320",start:85,end:92},{text:"Dieu",strong:"G2316",start:101,end:105},{text:"personne",strong:"G3762",start:111,end:119},{text:"faire",strong:"G1080",start:128,end:133},{text:"Dieu",strong:"G2316",start:163,end:167},{text:"avec",strong:"G1848",start:174,end:178}]},{number:3,text:"Odpowiedzia\u0142 Jezus i rzek\u0142 mu: Zaprawd\u0119, zaprawd\u0119 powiadam tobie: Je\u017ali si\u0119 kto nie narodzi znowu, nie mo\u017ce ujrze\u0107 kr\xf3lestwa Bo\u017cego.",strong:[{text:"homme",strong:"G444",start:62,end:67},{text:"nouveau",strong:"G2537",start:79,end:86},{text:"voir",strong:"G1492",start:99,end:103},{text:"Dieu",strong:"G2316",start:118,end:122}]},{number:4,text:"Rzek\u0142 mu Nikodem: Jako\u017c si\u0119 mo\u017ce cz\u0142owiek narodzi\u0107, b\u0119d\u0105c stary? aza\u017c mo\u017ce po wt\xf3re w \u017cywot matki swojej wnij\u015b\u0107 i narodzi\u0107 si\u0119?",strong:[{text:"homme",strong:"G444",start:29,end:34},{text:"dans",strong:"H6887",start:86,end:90}]},{number:5,text:"Odpowiedzia\u0142 Jezus: Zaprawd\u0119, zaprawd\u0119 powiadam tobie: Je\u017ali si\u0119 kto nie narodzi z wody i z Ducha, nie mo\u017ce wnij\u015b\u0107 do kr\xf3lestwa Bo\u017cego.",strong:[{text:"homme",strong:"G444",start:58,end:63},{text:"Esprit",strong:"G4151",start:83,end:89},{text:"dans",strong:"H6887",start:109,end:113},{text:"Dieu",strong:"G2316",start:128,end:132}]},{number:6,text:"Co si\u0119 narodzi\u0142o z cia\u0142a, cia\u0142o jest, a co si\u0119 narodzi\u0142o z Ducha, duch jest.",strong:[{text:"chair",strong:"G4561",start:20,end:25},{text:"chair",strong:"G4561",start:30,end:35},{text:"Esprit",strong:"G4151",start:59,end:65},{text:"Esprit",strong:"G4151",start:70,end:76}]},{number:7,text:"Nie dziw si\u0119, \u017cem ci rzek\u0142: Musicie si\u0119 narodzi\u0107 znowu.",strong:[{text:"nouveau",strong:"G2537",start:63,end:70}]},{number:8,text:"Wiatr, k\u0119dy chce, wieje, a g\u0142os jego s\u0142yszysz, ale nie wiesz, sk\u0105d przychodzi i k\u0119dy idzie; tak jest ka\u017cdy, kt\xf3ry si\u0119 narodzi\u0142 z Ducha.",strong:[{text:"vent",strong:"G4151",start:3,end:7},{text:"souffle",strong:"G4151",start:8,end:15},{text:"tout",strong:"G3956",start:118,end:122},{text:"homme",strong:"G444",start:123,end:128},{text:"Esprit",strong:"G4151",start:145,end:151}]},{number:9,text:"Odpowiedzia\u0142 Nikodem i rzek\u0142 mu: Jako\u017c si\u0119 te rzeczy mog\u0105 dzia\u0107?",strong:[{text:"faire",strong:"G1080",start:42,end:47}]},{number:10,text:"Odpowiedzia\u0142 Jezus i rzek\u0142 mu: Ty\u015b jest doktor Izraelski, a tego nie wiesz?",strong:[{text:"docteur",strong:"G1320",start:29,end:36}]},{number:11,text:"Zaprawd\u0119, zaprawd\u0119 powiadam tobie: \u017be co wiemy, m\xf3wimy, a co\u015bmy widzieli, \u015bwiadczymy, a \u015bwiadectwa naszego nie przyjmujecie.",strong:[]},{number:12,text:"Je\u017alim wam rzeczy ziemskie powieda\u0142, a nie wierzycie, jako\u017c uwierzycie, je\u017alibych wam powiada\u0142 rzeczy niebieskie?",strong:[]},{number:13,text:"A nikt nie wst\u0105pi\u0142 do nieba, tylko ten, kt\xf3ry zst\u0105pi\u0142 z nieba, Syn cz\u0142owieczy, kt\xf3ry jest w niebie.",strong:[{text:"Personne",strong:"G3762",start:0,end:8},{text:"ciel",strong:"H8064",start:24,end:28},{text:"ciel",strong:"H8064",start:68,end:72},{text:"Fils",strong:"G5207",start:77,end:81},{text:"homme",strong:"G444",start:87,end:92},{text:"dans",strong:"H6887",start:101,end:105},{text:"ciel",strong:"H8064",start:109,end:113}]},{number:14,text:"A jako Moj\u017cesz wywy\u017cszy\u0142 w\u0119\u017ca na puszczy, tak musi by\u0107 wywy\u017cszony Syn cz\u0142owieczy;",strong:[{text:"comme",strong:"G2531",start:3,end:8},{text:"serpent",strong:"G3789",start:24,end:31},{text:"dans",strong:"H6887",start:32,end:36},{text:"Fils",strong:"G5207",start:71,end:75},{text:"homme",strong:"G444",start:81,end:86}]},{number:15,text:"Aby ka\u017cdy, kto we\u0144 wierzy, nie zgin\u0105\u0142, ale mia\u0142 \u017cywot wieczny.",strong:[]},{number:16,text:"Albowiem tak B\xf3g umi\u0142owa\u0142 \u015bwiat, \u017ce Syna swego jednorodzonego da\u0142, aby ka\u017cdy, kto we\u0144 wierzy, nie zgin\u0105\u0142, ale mia\u0142 \u017cywot wieczny.",strong:[{text:"Dieu",strong:"G2316",start:4,end:8},{text:"monde",strong:"G2889",start:24,end:29},{text:"Fils",strong:"G5207",start:48,end:52},{text:"unique",strong:"G1520",start:53,end:59}]},{number:17,text:"Bo nie pos\u0142a\u0142 B\xf3g Syna swego na \u015bwiat, aby s\u0105dzi\u0142 \u015bwiat, ale aby \u015bwiat przez niego by\u0142 zbawiony.",strong:[{text:"Dieu",strong:"G2316",start:0,end:4},{text:"Fils",strong:"G5207",start:35,end:39},{text:"dans",strong:"H6887",start:40,end:44},{text:"monde",strong:"G2889",start:48,end:53},{text:"monde",strong:"G2889",start:73,end:78},{text:"monde",strong:"G2889",start:97,end:102}]},{number:18,text:"Kto we\u0144 wierzy, nie bywa s\u0105dzony; ale kto nie wierzy, ju\u017c jest os\u0105dzony, i\u017c nie uwierzy\u0142 w imi\u0119 jednorodzonego Syna Bo\u017cego.",strong:[{text:"Fils",strong:"G5207",start:118,end:122},{text:"unique",strong:"G1520",start:123,end:129},{text:"Dieu",strong:"G2316",start:133,end:137}]},{number:19,text:"A to\u0107 jest s\u0105d, i\u017c \u015bwiat\u0142o\u015b\u0107 przysz\u0142a na \u015bwiat, ale ludzie umi\u0142owali wi\u0119cej ciemno\u015b\u0107 ni\u017celi \u015bwiat\u0142o\u015b\u0107; albowiem sprawy ich z\u0142e by\u0142y.",strong:[{text:"jugement",strong:"G2920",start:6,end:14},{text:"dans",strong:"H6887",start:49,end:53},{text:"monde",strong:"G2889",start:57,end:62}]},{number:20,text:"Ka\u017cdy bowiem, kto \u017ale czyni, ma w nienawi\u015bci \u015bwiat\u0142o\u015b\u0107 i nie przyst\u0119puje do \u015bwiat\u0142o\u015bci, aby nie by\u0142y karane uczynki jego.",strong:[{text:"peur",strong:"H3372",start:78,end:82}]},{number:21,text:"Ale kto czyni prawd\u0119, przyst\u0119puje do \u015bwiat\u0142o\u015bci, aby by\u0142y objawione uczynki jego, \u017ce w Bogu s\u0105 uczynione.",strong:[{text:"selon",strong:"G2531",start:20,end:25},{text:"Dieu",strong:"G2316",start:126,end:130}]},{number:22,text:"Potem przyszed\u0142 Jezus i uczniowie jego do ziemi Judzkiej, i tam z nimi przebywa\u0142 i chrzci\u0142.",strong:[{text:"dans",strong:"H6887",start:58,end:62},{text:"terre",strong:"H776",start:66,end:71},{text:"avec",strong:"G1848",start:101,end:105}]},{number:23,text:"A Jan te\u017c chrzci\u0142 w Ennon, blisko Salim, przeto i\u017c tam wiele w\xf3d by\u0142o; i przychodzili, i byli chrzczeni.",strong:[{text:"Jean",strong:"G2491",start:0,end:4},{text:"beaucoup",strong:"G4183",start:67,end:75}]},{number:24,text:"Bo jeszcze Jan nie by\u0142 wtr\u0105cony do wi\u0119zienia.",strong:[{text:"Jean",strong:"G2491",start:4,end:8}]},{number:25,text:"I sta\u0142o si\u0119 pytanie mi\u0119dzy uczniami Janowymi i \u017bydami o oczyszczeniu.",strong:[{text:"Jean",strong:"G2491",start:43,end:47},{text:"avec",strong:"G1848",start:60,end:64},{text:"Juif",strong:"G2453",start:68,end:72}]},{number:26,text:"I przyszli do Jana, m\xf3wi\u0105c mu: Mistrzu! Ten, kt\xf3ry by\u0142 z tob\u0105 za Jordanem, o kt\xf3rym\u015b ty \u015bwiadczy\u0142, oto on chrzci, a wszyscy id\u0105 do niego.",strong:[{text:"Jean",strong:"G2491",start:20,end:24},{text:"avec",strong:"G1848",start:64,end:68}]},{number:27,text:"Odpowiedzia\u0142 Jan i rzek\u0142: Nie mo\u017ce cz\u0142owiek wzi\u0105\u0107 nic, je\u017ali\u017cby mu nie by\u0142o dano z nieba.",strong:[{text:"Jean",strong:"G2491",start:0,end:4},{text:"homme",strong:"G444",start:18,end:23},{text:"recevoir",strong:"G3880",start:32,end:40},{text:"ciel",strong:"H8064",start:71,end:75}]},{number:28,text:"Wy sami mi jeste\u015bcie \u015bwiadkami, \u017cem powiedzia\u0142: Nie jestem ja Chrystusem, ale \u017cem jest pos\u0142any przed nim.",strong:[{text:"Christ",strong:"G5547",start:58,end:64}]},{number:29,text:"Kto ma oblubienic\u0119, oblubieniec jest; ale przyjaciel oblubie\u0144cowy, kt\xf3ry stoi i s\u0142ucha go, rado\u015bci\u0105 si\u0119 raduje dla g\u0142osu oblubie\u0144cowego. Ta tedy rado\u015b\u0107 moja jest wype\u0142niona.",strong:[{text:"cette",strong:"G3778",start:165,end:170}]},{number:30,text:"On musi rosn\u0105\u0107, ale ja umniejsza\u0107 si\u0119.",strong:[]},{number:31,text:"Kto z g\xf3ry przychodzi, nad wszystkich jest; kto jest z ziemi, z ziemi jest, i rzeczy ziemskie m\xf3wi. Ten, kt\xf3ry z nieba przychodzi, nad wszystkich jest.",strong:[{text:"terre",strong:"H776",start:69,end:74},{text:"terre",strong:"H776",start:85,end:90},{text:"comme",strong:"G2531",start:104,end:109},{text:"terre",strong:"H776",start:122,end:127},{text:"ciel",strong:"H8064",start:148,end:152}]},{number:32,text:"A co widzia\u0142 i s\u0142ysza\u0142, to \u015bwiadczy, ale \u015bwiadectwa jego \u017caden nie przyjmuje.",strong:[{text:"personne",strong:"G3762",start:51,end:59}]},{number:33,text:"Kto przyj\u0105\u0142 \u015bwiadectwo jego, potwierdzi\u0142, i\u017c B\xf3g jest prawdziwy.",strong:[{text:"Dieu",strong:"G2316",start:47,end:51}]},{number:34,text:"Albowiem kt\xf3rego B\xf3g pos\u0142a\u0142, s\u0142owa Bo\u017ce m\xf3wi; bo mu B\xf3g nie miernie daje Ducha.",strong:[{text:"Dieu",strong:"G2316",start:14,end:18},{text:"Dieu",strong:"G2316",start:47,end:51},{text:"Dieu",strong:"G2316",start:63,end:67},{text:"Esprit",strong:"G4151",start:87,end:93},{text:"avec",strong:"G1848",start:94,end:98}]},{number:35,text:"Ojciec mi\u0142uje Syna, a wszystko da\u0142 w r\u0119k\u0119 jego.",strong:[{text:"Fils",strong:"G5207",start:16,end:20}]},{number:36,text:"Kto wierzy w Syna, ma \u017cywot wieczny; ale kto nie wierzy Synowi, nie ujrzy \u017cywota, ale gniew Bo\u017cy zostaje na nim.",strong:[{text:"Fils",strong:"G5207",start:19,end:23},{text:"Fils",strong:"G5207",start:70,end:74},{text:"Dieu",strong:"G2316",start:116,end:120},{text:"demeure",strong:"H1004",start:121,end:128}]}]},s=r}}]);
